import 'bootstrap/dist/css/bootstrap.min.css'
import NavBar from '../Components/NavBar.jsx'
import AboutUs from '../Components/AboutUs.jsx'

function About() {
  return (
      <div className='About'>
        <NavBar />
        <br />
        <AboutUs />
     </div>
  );
}

export default About;
